import { MailWarningIcon } from "lucide-react";

function NotFound() {
  return (
    <div className="notFound">
      <div className="prefix">
        <p>404</p>
      </div>
      <div className="error-text">
        <p>Not Found</p>
      </div>
    </div>
  );
}

export default NotFound;
